import React from 'react'
import '../ComponentsCSS/FooterStyles.css';
import footerback from '../Assets/footerback.png';


export const Footer = () => {
  return (
    <>
      <section className='footer-background' id='footer'>
        <img className='footer-img' src={footerback}></img>
        <div class="-overlay" style="opacity: 0.7; background-color: rgb(101, 166, 209);">
       </div>
      </section>
    </>
  )
}
